Secondly, if im getting paid more to do a tiring difficult job, why would i need to resort to illegitimate sources of income to earn more and risk losing my job and reputation, when i can just live my life NOT doing illegal shit? 
Thirdly, ur statement “just because we dont earn much it means we tend to be corrupt?” shows that u clearly have a misunderstanding of my previous statement. “Higher wage = decreases corruption” does not imply that “lower wage = more corrupted”. “Increasing the wage decreases the chance of people wanting to do anything illegal.” Does not mean “low wage = always doing illegal stuff” does it? The wage has an impact on the tendency to be corrupted but it is not a direct correlation to being corrupted. It isnt a simple linear relationship like you think it is.

@sinkietemplatelife TLDR; it isnt a simple problem wif a direct correlation that u tink it is. “More wage = decrease corruption” does not equate to “less wage = more corrupted”
